import React from "react";
import { Box, Flex, IconButton, Link } from "@chakra-ui/core";
import NextLink from "next/link";
import {RegularWorkoutFragment} from "../generated/graphql";

interface DaySectionProps {
  workout: RegularWorkoutFragment;
}

export const DaySection: React.FC<DaySectionProps> = ({
  workout
}) => {


  return (
    <>
    {workout ? (
      <>
      <Flex key={workout.id} p={5} shadow="md" borderWidth="1px">
        <Box flex={1}>
          <Text>{workout.workoutDt}</Text>
          <Flex align="center">
            <Text flex={1} mt={4}>
              {workout.workoutType}
            </Text>
          </Flex>
        </Box>
      </Flex>
      </>
    ) : (<Box>Empty day</Box>)
    }
    </>
  );
};
